$\textbf{Mahali pa Zamani pa Juan}$

Juan hupanga stempu katika mkusanyiko wake kwa nchi na kwa muongo ambao zilitolewa. Bei alizolipia katika duka la stempu zilikuwa: Brazil na Ufaransa, senti $6$ kila moja, Peru senti $4$ kila moja, na Uhispania senti $5$ kila moja. (Brazil na Peru ni nchi za Amerika Kusini na Ufaransa na Uhispania ziko Ulaya.) [asy]
/* AMC8 2002 #8, 9, 10 Problem */
size(3inch, 1.5inch);
for ( int y = 0; y <= 5; ++y )
{

draw((0,y)--(18,y));
}
draw((0,0)--(0,5));
draw((6,0)--(6,5));
draw((9,0)--(9,5));
draw((12,0)--(12,5));
draw((15,0)--(15,5));
draw((18,0)--(18,5));

label(scale(0.8)*"50s", (7.5,4.5));
label(scale(0.8)*"4", (7.5,3.5));
